and transform custom\n            input_data = input_data_path_augmentation if table_name != 'PARKING_VIOLATION_ISSUED' else input_data_path_original\n            transformed_data = transform_initial.extract_transform(table_name=table_name,\n                                                                   data_path=input_data)\n\n            # Load custom to HDF5 and Parquet\n            load_initial.load(data=transformed_data,\n                              table_name=table_name,\n                              data_path=output_data_path,\n                              load_to_hdf5=environment_name == 'local')\n\n            peak_memory_usage = round(tracemalloc.get_traced_memory()[1] / 1000000, 2)\n            execution_time_in_s = round(time.time() - start_time, 2)\n            print(f'Table {table_name}: {peak_memory_usage}MB | {execution_time_in_s}s')\n\n            tracemalloc.stop()\n\n        &lt;/pre&gt;\n        "},"id":"8042","type":"Div"},{"attributes":{"coordinates":null,"group":null,"source":{"id":"7855"},"text":{"field":"memory"},"text_font_size":{"value":"1em"},"x":{"field":"x"},"x_units":"screen","y":{"field":"y"},"y_units":"screen"},"id":"7921","type":"LabelSet"},{"attributes":{"high":1,"low":0,"palette":["#ffffFF","#fefeFF","#fdfdFF","#fcfcFF","#fbfbFF","#fafaFF","#f9f9FF","#f8f8FF","#f7f7FF","#f6f6FF","#f5f5FF","#f4f4FF","#f3f3FF","#f2f2FF","#f1f1FF","#f0f0FF","#efefFF","#eeeeFF","#ededFF","#ececFF","#ebebFF","#eaeaFF","#e9e9FF","#e8e8FF","#e7e7FF","#e6e6FF","#e5e5FF","#e4e4FF","#e3e3FF","#e2e2FF","#e1e1FF","#e0e0FF","#dfdfFF","#dedeFF","#ddddFF","#dcdcFF","#dbdbFF","#dadaFF","#d9d9FF","#d8d8FF","#d7d7FF","#d6d6FF","#d5d5FF","#d4d4FF","#d3d3FF","#d2d2FF","#d1d1FF","#d0d0FF","#cfcfFF","#ceceFF","#cdcdFF","#ccccFF","#cbcbFF","#cacaFF","#c9c9FF","#c8c8FF","#c7c7FF","#c6c6FF","#c5c5FF","#c4c4FF","#c3c3FF","#c2c2FF","#c1c1FF","#c0c0FF","#bfbfFF","#bebeFF","#bdbdFF","#bcbcFF","#bbbbFF","#babaFF","#b9b9FF","#b8b8FF","#b7b7FF","#b6b6FF","#b5b5FF","#b4b4
